import React from 'react';

function Main(props) {
	return (

			<div>
				<h2>Food Search</h2>
				<form onSubmit='function'>
					<label htmlFor='search'></label>
					<input id='searchbar'></input>
					<button type='submit'>Button</button>
				</form>
			</div>

	);
}

export default Main;
